import net.sf.json.groovy.*;

def resBody = context.expand( '${Display product with spec ext id sellable#res_body}' );

def jsonBody = new JsonSlurper().parseText(resBody);

for (int i=0; i < jsonBody.size(); i++){
	def jsonProductInformation = jsonBody[i].productInformation;
	
	if (jsonProductInformation.status == "Sellable" ) {
		return jsonProductInformation.quantity;
	}
}

